import Word from "./Word/Word";
import GetAllWord from "../../components/DataDB/DataDB";


function WordList(props) {
    function renderWord(){
        let arr = [];
        GetAllWord().then(value => { arr = value; console.log(value) });
        console.log(arr);
        return arr.map(item => {
            console.log(item);
            return(
                <Word
                    key = {item.id}
                    word = {item.word}
                    translation = {item.translation}
                />)
        })};

    return (
        <div>
            {console.log(renderWord())}
            {renderWord()}
        </div>
    );
}

export default WordList;
